# 记录电梯的状态，在上或下或停留,0表示停留，1表示上，-1表示下，初始化为停留
# ele_temp_state电梯当前的临时状态,ele_long_state电梯的总体状态，
# 例如ele_temp_state为0的时候，ele_long_state可能是非0，但当前者为1/-1的时候，后者必然和前者一样
ele_temp_state,ele_long_state = [],[]
for i in range(5):
    ele_temp_state.append(0)
    ele_long_state.append(0)
#设定电梯内部任务的数据结构
#队列中的任务变量，dst_floor表示前往的目标楼层，inOut表示是否是内任务，还是外任务插进来的内任务
class innerUpTask:
    def __init__(self, dst_floor,inOut=True):
        self.dst = dst_floor
        self.inOut=inOut

    def __lt__(self, other):
        return self.dst < other.dst

    def __repr__(self):
        return str(self.dst)
#队列中的任务变量，dst_floor表示前往的目标楼层，inOut表示是否是内任务，还是外任务插进来的内任务
class innerDownTask:
    def __init__(self, dst_floor,inOut=True):
        self.dst = dst_floor
        self.inOut=inOut

    def __lt__(self, other):
        return self.dst > other.dst

    def __repr__(self):
        return str(self.dst)
#为每部电梯实现一个内部任务优先队列,后序用heappush和heappop操作这两个列表，实现堆
innerUpQueue = []
innerDownQueue = []
for i in range(5):
    innerUpQueue.append([])
    innerDownQueue.append([])
